// src/components/About.jsx

import React from 'react';
import './About.css'; // Add this for custom styling

function About() {
  return (
    <div className="about-container">
      <div className="about-header">
        <h1>About Us</h1>
        <p>Learn more about our company and team.</p>
      </div>
      <div className="about-content">
        <section className="about-section">
          <h2>Our Mission</h2>
          <p>We strive to provide the best service and products to our customers with integrity and innovation.</p>
        </section>
        <section className="about-section">
          <h2>Our Team</h2>
          <p>Meet the dedicated professionals behind our success. We are passionate about what we do and committed to excellence.</p>
        </section>
      </div>
    </div>
  );
}

export default About;
